INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Conçue pour les débutants, la guitare Bird STC1 permet de s'initier à la guitare électrique dans des conditions optimales. Un corps en frêne pour un instrument léger et confortable qui convient à tous les âges, trois micros simples pour un maximum de polyvalence, disponible en plusieurs coloris pour s'adapter au goût de chacun, une construction et des finitions soignées pour une guitare qui tiendra dans le temps, la STC1 ne demande qu'à être jouée.","STC1 RED","images/BIRD_STC1_RED.JPG",79,"REF.005",6,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("La gamme Bird acoustique et électro-acoustique a été spécialement pensée pour les guitaristes débutants. Sa configuration traditionnelle, table épicéa et corps acajou, confère aux guitares DG1 une belle sonorité, bien équilibrée, entre brillance et puissance. La très belle finition noire de la DG1 BK et son confort de jeu en font une guitare d apprentissage très réussie.","DG1 NOIRE","images/BIRD_DG1_BK.JPG",69,"REF.006",6,3);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Le ukulélé est l instrument idéal pour s initier à la musique en samusant. La gamme Bird UK1S se décline en plusieurs couleurs pour faire plaisir et se faire plaisir à petit prix.","UK1S NL SOPRANO","images/BIRD_UK1S_NT.JPG",19,"REF.007",6,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Blackjack SLS SLS pour Slim Line Series. En effet, le profil de manche est plus plat que traditionnellement chez Schecter. Et qui dit fin dit rapide et idéal pour le jeu soliste. D'autant plus que le dos du manche est satiné pour une vitesse de déplacement optimale. Le corps (aminci pour l'occasion) et le manche sont en acajou et la touche est en ébène. Pour plus de confort, la finition du manche est satinée. Autre particularité, la série est disponible en deux configurations de micros : Active avec les classiques Seymour Duncan Blackouts AHB-1 Passive montée en Seymour Duncan Full Shred SH-10 / JAZZ SH-2N Enfin, sachez que les C1 et C1FR (avec Floyd) sont disponibles avec l'option Sustainiac. Aussi, les modèles 7 et 8 cordes possèdent un diapason plus long pour assurer plus de punch dans les graves! Manche collé, acajou. Touche : palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Croix Gothiques Caisse : acajou, finition : Black (BLK) Accessoires: Marque des mécaniques : Grover Type de mécaniques : à blocage Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique: Marque des micros : EMG Type de micro : Actif Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Non ","BLACKJACK SLS C 8EX ACTIVE SATIN BLACK","images/SCHECTER_S_BLASLSC8EXA-SBK.JPG",1319,"REF.009",7,6);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Manche Type : Manche collé Bois : Acajou Finition : Laquée Touche Bois : Palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Gothic Cross Caisse Bois : Acajou Table : Erable Finition : Black Cherry (BCH) Accessoires Marque des mécaniques : Grover Type de mécaniques : Noir chromé Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique Type de micro : Actifs trois bobines (2 micros en 1) Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Électronique Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Oui, sur commande uniquement.","HELLRAISER C 8 BLACK CHERRY","images/SCHECTER_S_C-8HR-BCH.JPG",1302,"REF.010",7,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Manche collé, acajou. Touche : palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Croix Gothiques Caisse : acajou, finition : Black (BLK) Accessoires: Marque des mécaniques : Grover Type de mécaniques : à blocage Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique:Marque des micros : EMG Type de micro : Actif Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Non ","HELLRAISER C 8 BLACK","images/SCHECTER_S_C-8HR-BLK.JPG",1302,"REF.011",7,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Le ukulélé est l instrument idéal pour s initier à la musique en samusant. La gamme Bird UK1S se décline en plusieurs couleurs pour faire plaisir et se faire plaisir à petit prix.","UK1S NL SOPRANO","images/BIRD+UK1S+BL.JPG",19,"REF.012",6,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Fender vous apporte les sons apaisants des îles hawaïennes grâce au Ukulele Tenor Hau'oli en acajou. Le modèle Hau'oli, qui doit son nom au terme hawaïen signifiant heureux, évoque le son et l'esprit des ïles hawaïennes grâce aux éléments suivants : éclisses, dos et manche en acajou massif, tête exclusive inspirée de celle de la Telecaster, rosace en ormeau acrylique, housse et manuel d'utilisation.","TENOR HAU'OLI","images/FMIC+0955630021.JPG",183,"REF.013",2,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Fender vous apporte les sons apaisants des îles hawaïennes grâce au sublime Ukulele Tenor Nohea en koa. Le modèle Nohea, qui doit son nom au terme hawaïen signifiant ravissant, évoque le son et l'esprit des ïles hawaïennes grâce aux éléments suivants : éclisses, dos et manche en koa, filet de bordure en ormeau acrylique, filet de touche vieilli et tête exclusive inspirée de celle de la Telecaster.","TENOR NOHEA","images/FMIC+0955640021.JPG",289,"REF.014",2,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Ron Emory, guitariste du groupe T.S.O.L. depuis de nombreuses années, a insufflé à quelques guitares acoustiques Fender très particulières son style et son expertise en matière de punk SoCal. Parmi les modèles les plus récents et les plus éminents se trouve le nouveau modèle parlor « Loyalty » Ron Emory, dans lequel ce dernier a combiné plusieurs de ses caractéristiques préférées, sélectionnées parmi les nombreuses guitares qui constituent sa vaste collection. Le résultat ? Un modèle à petite caisse particulièrement abordable. La guitare « Loyalty » Ron Emory est dotée d’un corps de type « Parlor » classique et est disponible en deux versions : l’une possède une table en épicéa, un fond et des éclisses en acajou, un manche en acajou et une finition « Sunburst » de style vintage rappelant les années 30 ; l’autre dispose d’un corps tout frêne, d’un manche en érable et d’une finition « Butterscotch-stain » ressemblant à celle de sa Telecaster ’52. Les deux versions possèdent un barrage en « X » évidé et débité dans le sens de la fibre, un binding de corps et une magnifique rosace de type « herringbone », un profil de manche « soft V », un binding de manche vieilli, une touche en palissandre avec incrustations « diamond » et logo « Loyalty » au niveau de la 12ième frette, 20 grandes frettes de type vintage, une crosse Fender style années 70, une plaque de protection 3 plis, un chevalet en palissandre « Viking » de type vintage avec sillet compensé en Nubone Graphtech et des mécaniques à engrenages apparents.","RON EMORY LOYALTY PARLOR SUNBURST","images/FENDER+0968551998.JPG",339,"REF.015",2,3);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Evoking the bygone days of the front-room sing-along, Fender’s CP-100 Parlor acoustic is a small-body beauty - a rich voice and a wealth of vintage-style appointments. Features include a bound Acajou parlor-style body, elegant sunburst-finish top - quartersawn scalloped X bracing and pearl acrylic rosette, Acajou neck - dual-action truss rod, 20-fret rosewood fingerboard - smaller dot inlays (3 mm), rosewood bridge - compensated saddle and white pins, rosewood headstock veneer, open-gear chrome tuners and smooth satin finish.","CP-100 PARLOR","images/FMIC+0961571021.JPG",149,"REF.016",2,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Les nouvelles versions des guitares Fender MA-1 (mini acoustique) et MC-1 (mini classique) procurent une expérience de jeu digne d'instruments de taille normale bien plus onéreux. Ces guitares 3/4 solidement fabriquées produisent de superbes sonorités. Elles sont parfaitement adaptées pour les écoles de musique, les étudiants et pour les débutants qui se sentent plus à l'aise avec une guitare aux dimensions réduites. Les nouvelles caractéristiques comprennent des mécaniques améliorées pour une intonation plus stable, un logo Fender sur la tête de manche et un dos et des éclisses faits dans un bois tropical orné de superbes veines appelé Sapele. Cette essence produit un son doux et plein.","MA 1 3/4 STEEL STRING GLOSS PINK","images/FMIC+096-3002-056.JPG",155,"REF.017",2,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Humbucker DiMarzio Air Norton(manche) + humbucker DiMarzio Tone Zone (chevalet) accastillage chrome fumé corps en tilleule manche Super Wizard HP Prestige en érable & noyer touche érable chevalet Gibraltar Standard II mécaniques Gotoh MG-T étui rigide","RG652FX GK PRESTIGE JAPON GALAXY BLACK ","images/IBANEZ_Japan.JPG",1093,"REF.020",3,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Le ukulélé est l'instrument idéal pour s'initier à la musique en s'amusant. La gamme Bird UK1S se décline en plusieurs couleurs pour faire plaisir et se faire plaisir à petit prix.","UK1S NL SOPRANO","images/BIRD_UK1S_NT.JPG",19,"REF.024",6,7);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Fiables et peu onéreuses, les guitares classiques Bird sont idéales pour appréhender l'instrument. A chacun sa guitare ! La gamme est déclinée en plusieurs tailles pour s'adapter à tous les âges. Ce modèle 4/4 (taille adulte) accompagnera les enfants de plus de 10 ans dans leur apprentissage ou leur approfondissement de la guitare. ","CG1 4/4 NATURELLE","images/BIRD_CG1_NL.JPG",49,"REF.025",6,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Fabriquée au Portugal, la guitare classique Jóia a été conçue avec des bois sélectionnés avec soin pour leur qualité acoustique et leur profondeur sonore. Table massive en cèdre, manche acajou, touche ébène, finition irréprochable, la Jóia séduira le guitariste amateur et professionnel pour de longues heures de jeu.","JÓIA","images/EAGLETONE+JOIA.JPG",279,"REF.029",8,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Manche collé, acajou. Touche : palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Croix Gothiques Caisse : acajou, finition : Black (BLK) Accessoires: Marque des mécaniques : Grover Type de mécaniques : à blocage Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique: Marque des micros : EMG Type de micro : Actif Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Non ","HELLRAISER C 8 BLACK","images/SCHECTER_S_C-8HR-BLK.JPG",295,"REF.030",9,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Avec ce modèle de taille 1/2, Yamaha s’adresse aux plus jeunes en leur permettant de débuter sur un instrument de qualité à un prix tout doux. Les modèles 3/4 répondent parfaitement aux attentes des enfants désirant commencer la guitare. Cependant, les très jeunes ont besoin d’un instrument encore plus petit, ce qui nous a conduit à fabriquer ce modèle de taille 1/2, CGS102. Ses éclisses moins larges et son diapason court de 535mm garantissent un grand confort de jeu. Le son n’a pas été sacrifié grâce à l’association du épicéa et du meranti. La touche et le chevalet en palissandre illustrent la volonté de Yamaha de proposer un instrument économique à la qualité irréprochable. ","D'ETUDE CGS102 1/2","images/YAMAHA+CGS102.JPG",129,"REF.031",10,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Un BEST-SELLER... Fruit d’une collaboration active, passionnée, et passionnante avec le luthier Yao HANSON, créateur des guitares ALTAMIRA. Avec sa table en cèdre massif associée aux sonorités typiques espagnoles, son dos en acajou africain et sa finition satinée, la JM FOREST STUDENT délivre un son puissant, chaud et direct, ainsi qu’un excellent confort de jeu. Disponible également en version 3/4 pour les plus jeunes et régulièrement conseillée par les professeurs, cette excellente guitare au prix très attractif fait déjà toute la différence auprès des étudiants.","STUDENT 4/4","images/JMFSTUDENT44.JPG",239,"REF.032",11,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Elle perpétue aujourd’hui cet héritage avec sa gamme de guitares classiques, dont la série ‘Hirade’ qui porte le nom de cet homme qui a joué un grand rôle dans le succès de la marque. ","TH5C HIRADE NATURAL GLOSS","images/GTV-TH5C.JPG",1649,"REF.033",4,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Les guitares Cuenca offrent depuis la fin des années 70 une qualité de fabrication exceptionnelle. L'expertise professionnelle, associée à une sélection rigoureuse des bois, des matériaux utilisés, ainsi qu'un excellent séchage du bois, font de ces instruments des oeuvres d'art tant au niveau esthétiques, qu'au niveau sonore.","GAUCHER 10-L CEDRE","images/GCU+10+L.JPG",399,"REF.034",12,6);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`,`promotion_id`) VALUES ("Attendues avec ferveur dans l’univers de la guitare classique, le studio de design Algam et le Maitre luthier Michel Lâg ont pris le temps d’une réflexion technique et esthétique mesurée afin de proposer un instrument aux qualités irréprochables.","OCCITANIA 300 RED CEDRE","images/GLAOC300.JPG",379,"REF.035",5,2,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`,`promotion_id`) VALUES ("Les guitares classiques Esteve sont connues et reconnues dans le monde entier pour leurs qualités acoustiques et leur superbe finition. Fabriquées à partir des meilleures essences de bois, elles constituent un mélange parfait entre lutherie traditionnelle et techniques modernes. Grâce au savoir-faire de 50 artisans passionnés par leur métier, Esteve peut proposer une gamme variée de guitares dont la pureté de son devient une véritable source d'inspiration pour le musicien.","4ST SATIN","images/ESTEVE+15424SAT.JPG",379,"REF.036",13,2,2);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`,`promotion_id`) VALUES ("Les guitares classiques Esteve sont connues et reconnues dans le monde entier pour leurs qualités acoustiques et leur superbe finition. Fabriquées à partir des meilleures essences de bois, elles constituent un mélange parfait entre lutherie traditionnelle et techniques modernes. Grâce au savoir-faire de 50 artisans passionnés par leur métier, Esteve peut proposer une gamme variée de guitares dont la pureté de son devient une véritable source d'inspiration pour le musicien.","1.4ST","images/ESTEVE+1-4ST.JPG",355,"REF.037",13,2,3);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Avec la Raven, Eagletone s'ouvre à l'univers du gros son rock et métal. Spécialement conçue pour les sons agressifs et percutants, la configuration double micro Humbucker promet d'envoyer du lourd, tant sur les fréquences graves que sur les fréquences aiguës. Polyvalente, sobre, brutale, la Raven est la guitare qu'il vous faut pour passer du côté obscur, sans perdre un bras au passage.","RAVEN NOIRE","images/EAGLETONE+RAVEN.JPG",169,"REF.038",8,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Une ligne classique qui ne vieillit pas, une configuration chevalet tune o matic et micros double bobinage qui apporte sustain et attaques féroces, la South State C100 passe avec aisance du rock au blues et du métal au punk. Fidèle à la philosophie Eagletone, ce modèle propose un manche confortable, une excellente jouabilité et une qualité de construction impeccable. Une guitare qui, tout comme son look, est faite pour durer. ","SOUTH STATE C100 MATT GREY","images/EAGLETONE+SOUTH+STATE+C100+GRISE+MATE.JPG",169,"REF.039",8,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Conçue pour les débutants, la guitare Bird STC1 permet de s'initier à la guitare électrique dans des conditions optimales. Un corps en frêne pour un instrument léger et confortable qui convient à tous les âges, trois micros simples pour un maximum de polyvalence, disponible en plusieurs coloris pour s'adapter au goût de chacun, une construction et des finitions soignées pour une guitare qui tiendra dans le temps, la STC1 ne demande qu'à être jouée.","STC1L SUNBURST - GAUCHER","images/BIRD+STC1L+SUNBURST.JPG",79,"REF.040",6,6);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Corps érable","LES PAUL T TRADITIONAL 2017 ","images/GBI+LPTD17A6NH1.JPG",2299,"REF.041",1,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("shville USA - Corps en Acajou massif sculpté avec fond dur Aniline Dye tel que dans les années 60 (couleur rouge historique) - Manche en Acajou massif avec profil fin ’60- Touche en Palissandre massif une pièce avec incrustations en acrylique- Plaque de tête Holly headstock Veneer avec incrustations en acrylique - Truss-Rod Historique et non tubé - Jonction corps-manche avec long tenon et collée par Hide Glue authentique pour davantage de sustain - Manche 21 cases et 22 frettes Medium Jumbo (alliage 80% nickel - 20% argent) - Diapason : 24.75 - Radius : 12 - Largeur au sillet : 1.6875","SG STANDARD REISSUE STOPBAR","images/SGSR3VOFCNH1.JPG",3190,"REF.042",1,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Corps acajou Manche acajou Profil flying V slim taper Sillet Tektoid Largeur du sillet 1.695 (43,05mm) Touche grenadillo Radius 12 Frettes 22 Diapason 24,75 (628,65mm) Contrôles Master Tonalité, volume micro chevalet, volume micro ","FLYING V T 2017 ALPINE WHITE","images/GBI+DSV17AWCH1.JPG",1219,"REF.043",1,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Corps acajou Manche acajou Profil flying V slim taper Sillet Tektoid Largeur du sillet 1.695 (43,05mm) Touche grenadillo Radius 12 Frettes 22 Diapason 24,75 (628,65mm) Contrôles Master Tonalité, volume micro chevalet, volume micro ","FLYING V T 2017 EBONY","images/GBI+DSV17EBCH1.JPG",1199,"REF.044",1,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("En 1960, Gibson change la forme de la Les Paul et lance la guitare qui prendra ensuite le nom de SG. Face à la demande insistante des guitaristes à la recherche du modèle historique, ils rééditent finalement la Les Paul en 1968 avec leur fameuse Custom Black Beauty, dans une version bien particulière qui a depuis séduit de nombreux musiciens en rock, punk et glam. La qualité de production a commencé à décliner à cette époque, mais quelques rares modèles y ont échappé et sont devenus les outils des guitare heroes des décennies 70 et 80. Parmi elles, la Les Paul Custom sandwich (ainsi nommée pour son corps en trois parties, avec érable et acajou) est un instrument très particulier et recherché, une bête de scène prête à vous suivre en rock, métal et bien d'autres. Fatigué des copies, variations et autres interprétations ? Il est temps de passer à l'originale...","1974 LES PAUL CUSTOM REISSUE ","images/GIBSON+LPC74VOEBGH1.JPG",6399,"REF.045",1,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Corps érable Manche acajou Profil Les Paul Standard Sillet Nylon Largeur du sillet 1.695 (43,05mm) Touche palissandre Radius 12 Frettes 22 Diapason 24,75 (628,65mm) Contrôles Volumes micro chevalet et micro manche, Tonalités micro ","GAUCHER LES PAUL TRADITIONAL","images/GBI+LPTD17LHBNH1.JPG",1990,"REF.046",1,6);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Conçue pour des guitaristes par des guitaristes, la gamme Eagletone DELUXE 20 compile toutes les qualités que nous avons appréciées dans les meilleures housses du marché. Les guitaristes et bassistes de l'équipe Eagletone ont tous apporté leur contribution à la réalisation d'une série idéale devant répondre à ces critères :","DELUXE 20 B","images/EAGLETONE+DELUXE+20B.JPG",49,"REF.047",8,8);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Conçue pour des guitaristes par des guitaristes, la gamme Eagletone DELUXE 30 compile toutes les qualités que nous avons appréciées dans les meilleures housses du marché. Les guitaristes et bassistes de l'équipe Eagletone ont tous apporté leur contribution à la réalisation d'une série idéale devant répondre à ces critères :","DELUXE 30 CL","images/EAGLETONE+DELUXE+30CL.JPG",49,"REF.048",8,8);
