INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Série Standard en nylon 600 deniers, doublure 210 deniers et mousse haute densité 5mm. 1 poche accessoires, 2 sangles cousues ajustables  ","HOUSSE GUITARE NOIRE SERIE 20","images/SERIE20.JPG",13,"REF.050",15,8);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("L’AT4080 dont la forme est celle des microphones de studio à condensateur classique est recommandé pour les voix, les cordes, instruments acoustiques, les overheads de batteries. ","AT4080","images/AT4080.JPG",880,"REF.051",16,9);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("L’AT4081 bénéficie de cette nouvelle technologie qui lui permet de restituer dans les moindres détails un son chaud et naturel avec une parfaite précision afin de répondre aux exigences les plus pointues des professionnels de l’enregistrement, de la radiodiffusion et de la sonorisation.","AT4081","images/AT+4081+AUDIO+TECHNICA+MICRO+STUDIO.JPG",629,"REF.052",16,9);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("En studio, le M160 est particulièrement apprécié comme overhead, mais aussi sur le piano, les violons, les saxophones et les voix.","M160","images/BEYER+M160.JPG",499,"REF.053",17,9);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`,`promotion_id`) VALUES ("La douceur légendaire du ruban pour la prise de voix sur scène, appréciable, entre autre, sur les voix féminines.","TG V90R","images/BEYER+TGV90R.JPG",379,"REF.054",17,9,1);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("La gamme de cordes Eagletone pour guitare classique est fabriquée selon les techniques de filage traditionnelles pour obtenir des cordes régulières et consistantes. Ce jeu s'adresse tout particulièrement aux guitaristes débutants.","CS N - TENSION NORMALE","images/EAGLETONE+CS+N.JPG",3,"REF.055",8,10);
INSERT INTO  `bdd_airguitare`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("La gamme de cordes Eagletone pour guitare classique est fabriquée selon les techniques de filage traditionnelles pour obtenir des cordes régulières et consistantes. Ce jeu offre un son riche et une projection équilibrée, ainsi qu'une bonne stabilité d'accordage grâce à la qualité des matériaux utilisés pour sa fabrication.","CSHQ H - TENSION FORTE","images/EAGLETONE+CSHQ+H.JPG",7,"REF.056",8,10);
